import React from "react";
import "./App.scss";
import Form from "./Form";
import Article from "./Article";

class App extends React.Component {
  render() {
    return (
      <React.Fragment>
        <h1>What's your favorite film?</h1>
        <Form handleChange={this.handleChange} />
        <Article />
      </React.Fragment>
    );
  }
}

export default App;
